  // }else{
    ISU.select(`#${this.id} .contents .alinedImages`).style.display = 'initial';
  // }
}
Thumbnails.prototype.stopThumbnail = function(){

    ISU.select(`#${this.id} .contents .alinedImages`).style.display = 'none';

  //if(innerWidth < 1400){
